import "./App.css";
import Homepage from "./components/homepage/Homepage";
import Concerte from "./components/concerte/Concerte";

function App() {
  return (
    <>
      <div
        style={{ height: "50px", width: "100%", background: "light-purple" }}
      />
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/concerte" element={<Concerte />} />
        <Route path="/cultura" element={<EvenimenteCulturale />} />
        <Route path="/evenimentesportive" element={<EvenimenteSportive />} />
        <Route
          path="/spectacolepentrucopii"
          element={<SpectacolePentruCopii />}
        />
      </Routes>
      <div
        style={{ height: "50px", width: "100%", background: "light-yellow" }}
      />
    </>
  );
}

export default App;
